import { Grid, Card, Typography, CardContent, TextField, Button } from "@mui/material";
export default function NewProduct() {


const handleSubmit=(e)=>{
    e.preventDefault();
    
}

    return (
        <Grid container
            direction="column"
            alignItems="center"
            justifyContent="center"

        >
            <Grid item xs={3}>
                <Card
                    sx={{ mt: 5 }}
                    style={{
                        backgroundColor: "#1e272e",
                        padding: "1rem"
                    }}
                >
                    <Typography variant="5" textAlign="center" color="white">
                        New Product
                    </Typography>
                    <CardContent>
                        <form onSubmit={handleSubmit}>
                            <TextField
                                variant="filled"
                                label="Product Name"
                                sx={{
                                    display: "block",
                                    margin: ".5rem 0"
                                }}
                                inputProps={
                                    { style: { color: "white" } }
                                }
                                InputLabelProps={
                                    { style: { color: "white" } }
                                }
                            >

                            </TextField>
                            <TextField
                                variant="filled"
                                label="amount"
                                type="number"
                                sx={{
                                    display: "block",
                                    margin: ".5rem 0"
                                }}
                                inputProps={
                                    { style: { color: "white" } }
                                }
                                InputLabelProps={
                                    { style: { color: "white" } }
                                }>
                            </TextField>

                            <TextField
                                variant="filled"
                                label="price $"
                                type="number"
                                sx={{
                                    display: "block",
                                    margin: ".5rem 0"
                                }}
                                inputProps={
                                    { style: { color: "white" } }
                                }
                                InputLabelProps={
                                    { style: { color: "white" } }
                                }></TextField>

                            <Button variant="contained" color="primary" type="submit">
                                ADD
                            </Button>

                        </form>
                    </CardContent>
                </Card>
            </Grid>
        </Grid>
    )
}
